('18003466', '03.18.0721.2962', 'MIKA SAPUTRI', 'P', NULL, '1999-10-16', '', 'Batu Kajang', 23, '085725677748', 'Saputrimikha3@gmail.com', '031807212962', '18003466', '161000', 2018, 2021, '0000-00-00', 614010, '614010a', '3.68', '085725677748', 'Mikha Saputri', '_bebymimi', NULL, NULL, NULL, '10F54555-FDC4-4EE7-BCDC-5027681E0DE91.jpeg', 'Jangan pernah menyerah untuk meraih cita-cita. Percayalah masa lalu yang buruk bukan sebagai penentu masa depan kelak. Sedikit saya berbagi cerita, bahwa saya anak broken home. Dimana saya pernah putus sekolah tepat ketika duduk di sekolah dasar kelas enam. Saya pernah putus asa sehingga tidak berniat sekolah lagi, namun takdir berkata lain dan saya tetap bisa sekolah bahkan selalu lulus tepat waktu. Saya tidak menyangka dengan berusaha dan giat belajar saya bisa mencapai semuanya. Saya bangga bisa kuliah di AMAYO tercinta. Dengan memilih AMAYO saya bukan hanya belajar tentang ilmu, tetapi saya juga belajar tentang arti kehidupan sesungguhnya. Jaya selalu AMAYO tercinta.', '', '2021-04-06 14:20:13', '2021-07-15 13:02:54', b'0', b'1', b'1', '170998f3cc6fd319417776a6ab79a33a'),
